function Cards(props){
    return(
        <>
        <div className="card">
            <h1 className="header">{props.sname}</h1>
            <div>
            <img src="" alt="Image here" />
            <a href="">
                <button>Watch Now</button>
            </a>
            </div>
        </div>
        </>
    )
}
export default Cards;
